import { createSlice } from "@reduxjs/toolkit";

const initialState =  [
  {
      id: 1,
      title: 'Beetlejuice',
      year: '1988',
  },
  {
      id: 2,
      title: 'Ghostbusters',
      year: '1984',
  },
];


const accountReducer = createSlice({
  name: "accounts",
  initialState,
  reducers: {},
});

export default accountReducer.reducer;
